import styled from 'styled-components';
import Nav from './Nav';

const HeaderStyles = styled.header`
  .sub-bar {
    display: grid;
    grid-template-columns: 1fr auto;
    width: 40%;
    border: 1px solid grey;
    border-radius: 5px;
  }

  .sub-bar p {
    padding: 5px 10px;
    margin: 0;
  }
`;

const Header = () => (
  <HeaderStyles>
    <Nav />
  </HeaderStyles>
);

export default Header;
